import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col, Button, Carousel } from 'react-bootstrap';
import RollerCoasterText from './AboutPageComp/RollerCoasterAnim';
import CoreValues from './AboutPageComp/Corevalues';
import AboutValues from './AboutPageComp/Aboutvalues';
import Gateway from './AboutPageComp/Gateway';
import Timeline from './AboutPageComp/Timeline';
import Mission from './AboutPageComp/Mission';
import ImageSlider from './AboutPageComp/ImageSlider';
// import Appointment from '../HomePage/HomePageComp/appointment';

const About = () => {
  return (
    <>
    {/* <Header /> */}
      <Gateway />
      <Timeline />
      <Mission />
      <ImageSlider />
        <RollerCoasterText />
        <AboutValues />
        {/* <CoreValues /> */}
        {/* <Appointment /> */}
    </>
  );
};

export default About
